import React, { Component } from "react";

class EventDetail extends Component {
    constructor(props) {
        super(props);
        this.current_event_id = window.location.href.split("/")[4]
    }


    render() {
        // depending on the state we either generate
        // useful message to the user or show the list
        let attendent_list = event.attendents.forEach(attendent => {
                        attendent
                    });
        let current_event = this.props.events.map(event => {
            if (event.database_id == this.current_event_id) {
                return (<div key={event.database_id}>
                    <h1>{event.title}</h1>
                    <h3>{event.date}</h3>
                    <p>{event.description}</p>
                        <p>Attendents: {attendent_list}</p>
                </div>)
            }
        })
        return (
            <div className="events">
                    {current_event}
            </div>
        );
    }
}

export default EventDetail;
